import React from 'react';
import s from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = () => {
    return (
    <div>
        <div>
            My post
        </div>
        <div>
            <textarea></textarea>
            <button>Post</button>
        </div>
        <Post massage="Hi, how are you?" text="3"/>
        <Post massage="It's my first post" text="6"/>
        <Post massage="It's my second post" text="10"/>
    </div>
    );
}

export default MyPosts;
